member.returns:
True if the MetricSeries indicated by the specified dimension names could be retrieved or created;
            False if the indicated series could not be retrieved or created because createIfNotExists is false
            or because a dimension cap or a metric series cap was reached.

summary.para:
For example, use this metric configuration to measure:

            Size and number of server requests per time period; Duration and rate of database calls per time period;
            Number of sale events and number of items sold per sale event over a time period, etc.

